function ShowShareDialog(n){var e=document.getElementById("share-dialog"+n);if(e)return"block"==e.style.display?e.style.display="none":e.style.display="block",!1}function CloseShareDialog(n){var e=document.getElementById("share-dialog"+n);if(e)return e.style.display="none",!1}function __function_exists(n){return"string"==typeof n?"function"==typeof window[n]:n instanceof Function}